import React from 'react';
import './App.css';
import Navbar from './components/Navbar/Navbar';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Home from '.components/pages';
import About from '.components/pages/home';
import Events from '.components/pages/cart';
import AnnualReport from '.components/pages/wishlist';
import Teams from '.components/pages/account';
import Blogs from '.components/pages/login';
import SignUp from '.components/pages/create-acc';

function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
      <Route path='/' exact component={Home} />
        <Route path='/home' component={Home} />
        <Route path='/cart' component={Cart} />
        <Route path='/wishlist' component={Wishlist} />
        <Route path='/account' component={Account} />
        <Route path='/login' component={Blogs} />
        <Route path='/create-acc' component={SignUp} />
      </Switch>
    </Router>
  );
}

export default App;
